import React, { useContext } from 'react';
import {observer} from 'mobx-react-lite'


const CategoryBar = observer(() => {
    const {part} = useContext;
    return (
        <ul>
            <li>Один</li>
            <li>Один</li>
            <li>Один</li>
            <li>Один</li>
            <li>Один</li>
            <li>Один</li>
            
        </ul>
    );
});

export default CategoryBar;
